sap.ui.define(["hckt/manifest/controller/baseController"],function(t){return t.extend("hckt.manifest.controller.master",{onInit:function(){this.oRouter=this.getOwnerComponent().getRouter()},onItemPress:function(t){var e=t.getParameter("listItem");var r=this.passListItem(e);this.oRouter.navTo("master_fruit",{productId:r})},onNext:function(){this.next()},onLiveSearch:function(t){var e=t.getParameter("newValue");this.getLiveSearch("product",e,"idList")},onRefresh:function(t){var e=t.getParameter("refreshButtonPressed");this.getRefresh(e)}})});